import {Route} from 'react-router-dom'
import MainNavigation from './components/layout/MainNavigation';
import AllQuotes from './pages/AllQuote';
import AddNewQuote from './pages/AddNewQuote';
function App() {
  return (
    <div>
        <MainNavigation/>
        <Route path='/allquotes'>
            <AllQuotes/>
        </Route>
        <Route path='/allquote'>
            <AddNewQuote/>
        </Route>

    </div>
  );
}

export default App;
